import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import {Outlet, Link} from "react-router-dom";
import Root, {loader as rootLoader } from "./routes/root";
export default function VizNavigation() {

  return (
      <div id="navigation-viz">
        <Navbar expand="lg" className="navbar-form navbar-fixed-top">
          <Container>
            <Navbar.Toggle aria-controls="basic-navbar-nav"/>
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Link to={``}>Home</Link>
                {<NavDropdown title="Example Crime Category" id="basic-nav-dropdown">
                  <NavDropdown.Item><Link to={`/dataset-overview`}>Sample Page Layout (cats)</Link></NavDropdown.Item>
                </NavDropdown>}
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>
  );
};
